import React from "react";

export const ButtonHomePage = ({ setHomePage }) => {
  return (
    <button
      className="btnPrimary"
      onClick={() => {
        setHomePage(false);
      }}
    >
      Iniciar
    </button>
  );
};

export const ButtonHome = ({ setHomePage }) => {
    return (
      <button
        className="btn"
        onClick={() => {
          setHomePage(true);
        }}
      >
        Inicio
      </button>
    );
  };
